INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (401, "アヤネ", 10046, 102301, 24001, 0.0, 24, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (402, "アヤネ", 10046, 102301, 24002, 2.21, 24, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (403, "アヤネ", 10046, 102301, 24003, 0.0, 24, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (701, "アサヒ", 10046, 192201, 24004, 1.99, 24, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (702, "アサヒ", 10046, 192201, 24005, 2.21, 24, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (703, "アサヒ", 10046, 192201, 24006, 3.33, 24, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (801, "部員３", 10046, 192301, 24007, 0.0, 24, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (802, "部員３", 10046, 192301, 24008, 2.68, 24, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (803, "部員３", 10046, 192301, 24009, 0.0, 24, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (501, "", 10046, 192501, 24010, 0.0, 24, "やった！", 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (502, "", 10046, 192501, 24011, 0.0, 24, "勝ったよ！", 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (503, "", 10046, 192501, 24012, 0.0, 24, "いい調子！", 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (111, "ミサト", 10046, 113501, 24013, 5.33, 24, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 2, 0.0, 6, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (112, "ミサト", 10046, 113501, 24014, 6.85, 24, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (113, "ミサト", 10046, 113501, 24015, 3.0, 24, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (611, "ダイチ", 10046, 192401, 24016, 6.11, 24, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (612, "ダイチ", 10046, 192401, 24017, 6.75, 24, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (613, "ダイチ", 10046, 192401, 24018, 0.0, 24, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (211, "ハツネ", 10046, 113401, 24019, 4.52, 24, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (212, "ハツネ", 10046, 113401, 24020, 3.89, 24, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (213, "ハツネ", 10046, 113401, 24021, 13.49, 24, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (311, "カヤ", 10046, 106501, 24022, 3.17, 24, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (312, "カヤ", 10046, 106501, 24023, 4.42, 24, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (313, "カヤ", 10046, 106501, 24024, 2.89, 24, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 1, 0.0, 6, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (421, "アヤネ", 10046, 102301, 24025, 3.71, 24, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3, 0.0, 4, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (721, "アサヒ", 10046, 192201, 24026, 5.1, 24, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (821, "部員３", 10046, 192301, 24027, 4.34, 24, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 3, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (521, "", 10046, 192501, 24028, 0.0, 24, "いい勝負だったよ\nまたやろうね", 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (101, "ミサト", 10046, 113501, 24029, 5.62, 24, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 2, 0.0, 1, "2030/12/17 14:59:59", -360.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (102, "ミサト", 10046, 113501, 24030, 9.58, 24, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 2, 0.0, 1, "2030/12/17 14:59:59", -360.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (103, "ミサト", 10046, 113501, 24031, 0.0, 24, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 0.0, 2, "2030/12/17 14:59:59", -360.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (104, "ミサト", 10046, 113501, 24032, 9.13, 24, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 1, 0.0, 2, "2030/12/17 14:59:59", -360.0, "2020/07/31 12:00:00");
INSERT INTO `v1_3684a35bfaee87fb9a0ea025fa220c0f6608ed1a9135b4cdea91de32cbd5ba51` VALUES (105, "ミサト", 10046, 113501, 24033, 8.27, 24, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 2, 0.0, 1, "2030/12/17 14:59:59", -360.0, "2020/07/31 12:00:00");
